!     the array, js, runs from 1 to 5, and corresponds to different o3 to
!     co2 ratios, as expressed through the binary species parameter eta,
!     defined as eta = o3/(o3+rat*co2), where rat is the ratio of the
!     integrated line strength in the band of co2 to that of o3.  for
!     instance, js=1 refers to no o3 (eta = 0) and js = 5 corresponds to
