!========================================!
      module module_radlw_kgb11          !
!........................................!
!
      use machine,                 only : kind_phys
      use module_radlw_parameters, only : NG11
!
      implicit none
!
      private
!
      integer, public :: MSA11, MSB11, MSF11
      parameter (MSA11=65, MSB11=235, MSF11=10)
 
      real (kind=kind_phys), public ::                                  &
     &       absa(MSA11,NG11), absb(MSB11,NG11), selfref(MSF11,NG11),   &
     &       fracrefa(NG11), fracrefb(NG11)
 
!     the array absa(65,NG11) = ka(5,13,NG11) contains absorption coefs at
!     the NG11=8 chosen g-values for a range of pressure levels > ~100mb
!     and temperatures.  the first index in the array, jt, which runs from
!     1 to 5, corresponds to different temperatures.  more specifically,
!     jt = 1-5 means that the data are for the corresponding temperature of
!     tref-30, tref-15, tref, tref+15, and tref+30, respectively.  the
